import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom'
import "./App.css";
import Header from './components/Header';
import Projects from "./components/projects";


function App() {
  return (
    <Router>
    <div className="app">
      <Switch>
        <Route path='./components/Projects.jsx'>
          <Header />
          <Projects />
       </Route>

       <Route path='./components/Resume.jsx'>
          <Header />
          <Resume />
       </Route>

       <Route path='../src/components/Projects'>
          <Body />
          <Projects />
       </Route>
    </Switch>
    </div>
    </Router>
  )
}


export default App;
